Here is a sample code for this task:

```
import org.apache.spark.sql.SparkSession;
import org.apache.spark.sql.functions.*;

public class HitRate {
    public static void main(String[] args) {
        SparkSession spark = SparkSession.builder()
                .appName("HitRate")
                .master("local[*]")
                .getOrCreate();

        // Assuming that onsite attributed data is in a CSV file with columns query and timestamp
        Dataset<Row> onsiteAttributedData = spark.read().csv("path/to/onsiteAttributedData.csv");

        // Assuming that top frequent queries are in a CSV file with column query
        Dataset<Row> topFrequentQueries = spark.read().csv("path/to/topFrequentQueries.csv");

        // Join onsiteAttributedData and topFrequentQueries on query column
        Dataset<Row> joinedData = onsiteAttributedData.join(topFrequentQueries, onsiteAttributedData.col("query").equalTo(topFrequentQueries.col("query")));

        // Group by query and timestamp and count the number of hits and misses
        Dataset<Row> groupedData = joinedData.groupBy("query", "timestamp").agg(count("*").as("count"));

        // Sum up the number of hits and misses
        Dataset<Row> sumData = groupedData.groupBy("query").agg(sum("count").as("sum"));

        // Divide the number of hits by the number of misses to get the hit rate
        Dataset<Row> hitRateData = sumData.withColumn("hitRate", col("sum").div(sumData.select(sum("count")).first().getLong(0)));

        // Show the hit rate data
        hitRateData.show();
    }
}
```

